# streatley hill

latLng = data[0]["data"] # creating a list of latlng tuples
bearings = []

for i in range(len(latLng)-1): # calculating bearing list from latLng list
    point1 = latLng[i]
    point2 = latLng[i+1]
    
    dL = point2[1]-point1[1]
    
    X = cos(point2[0])* sin(dL)
    Y = cos(point1[0])*sin(point2[0]) - sin(point1[0])*cos(point2[0])* cos(dL)
    
    bearingRad = arctan2(X,Y)
    bearings.append(((degrees(bearingRad)+360) % 360))
    

distances=data[1]["data"] # creating a list of distances
elevations=data[2]["data"] # which match with this list of elevations (both list have same number of items)

for i in range(len(distances)): # stops the program crashing if elevation data is very poor - but will not properly fix it
    if i > 0:
        if distances[i] == distances[i-1]:
            distances[i] = distances[i] + 0.1

segmentdata = np.column_stack((distances,elevations))
segmentdatainterp = interp1d(distances, elevations, kind="cubic") # fitting a cubic spline to the data points

courseLength = distances[-1]

def getGrad(dist): # function that returns the current gradient
    if dist <= 0.1:
        grad = (segmentdatainterp(dist + 0.1) - segmentdatainterp(dist))/0.1
    elif dist >= courseLength - 0.1:
        grad = (segmentdatainterp(courseLength) - segmentdatainterp(courseLength - 0.1))/0.1
    else:
        grad = scipy.misc.derivative(segmentdatainterp, dist, 0.1)
    return(grad)


def plotSegment(samples): # a function to plot the segment data with the chosen number of samples
    xnew = np.linspace(0, courseLength, num=samples, endpoint=True)
    distances = []
    elevations = []
    gradients = []
    
    for i in xnew:
        distances.append(i)
        elevations.append(segmentdatainterp(i)-segmentdatainterp(0))
        gradients.append(getGrad(i)*100)
        
    plt.plot(distances, elevations, label="Elevation (m)")
    plt.plot(distances, gradients, label="Gradient (%)")
    plt.xlabel("Distance (m)")
    plt.legend(loc='best')
    plt.xlim(0, distances[-1])
    plt.grid()